@NgModule({
  declarations: [
    AppComponent,
    PersonajesComponent,
    PrincipalComponent
  ],
  imports: [
    BrowserModule,
    RouterOutlet,
    RouterLinkActive,
    RouterLink,
      HttpClientModule

  ],
